import React from 'react'
import Typist from 'react-typist';
import ForumIcon from '@material-ui/icons/Forum';
function Home() {
    return (
        <div className='homeContainer'>
            <div className='forumIcon'>
                <ForumIcon style={{ fontSize: 50 }} />
            </div>
            <div>
                <Typist cursor={
                    {
                        hideWhenDone: true
                    }
                }>
                    <span> Welcome To Magic Chat Application.</span>
                    <Typist.Delay ms={1000} />
                    <br />
                    <br />
                    <span>Developed By Nishant Rana.</span>
                </Typist>
            </div>
        </div >
    )
}

export default Home
